      "excerpt": "<font color=\"#616AE5\" size=3.5 style=\"line-height: 35px;\">\n&emsp;&emsp;<strong>地理与气象分析库（Geographic and Meteorological Analysis，简称 gma）</strong>，\n</font>\n是一个基于 Python 的地理、气象数据快速处理分析和地理制图函数包。构建过程参考了ArcGIS和QGIS的操作逻辑和特点，并添加诸多独创性、独有的功能，具有独特的代码构造理念。\n<p>  整体上，gma遵循易用至上、开放共享、效率更新的原则，不断整合优秀的、前沿的、大众急需的地理/气象相关模型算法，力争打造国内独具特色的集地理数据处理和分析、气象指标计算、地理空间绘图等功能为一体函数包，以简单的用法、完整的帮助说明、典型的示例等使用者可以快速入手，并解决现实问题。</p>\n<p>  目前，gma 2 已经发布，相较于 gma 1，其底层算法逻辑彻底重构，功能函数重新归类，类结构和功能逻辑更加清晰，其更像是gma真正意义上的第一个正式版。</p>\n<div class=\"custom-block warning\"><p class=\"title\">注意</p><ul>\n<li>\n<p>gma 2 已经发布，并且数十年内不会进行大的用法调整！</p>\n</li>\n<li>\n<p>gma 1 不在提供支持，本站内容均建立于gma 2。</p>\n</li>\n</ul>\n</div>"
